import React from "react";
import { Nav, NavItem, NavLink } from "reactstrap";
import "./TopNav.css";

const TopNav = props => {
  return (
    <div>
      <Nav>
        <NavLink href="#" id="aboutUs">
          Link
        </NavLink>{" "}
        <NavLink href="#" id="wallet">
          Link
        </NavLink>{" "}
        <NavLink href="#" id="shop">
          Another Link
        </NavLink>{" "}
        <NavLink disabled href="#">
          Disabled Link
        </NavLink>
      </Nav>
    </div>
  );
};

export default TopNav;
